import './App.css';
import { Routes, Route } from "react-router-dom";
import { LoginPages } from './pages';
function App() {
  return (
    <div>
     <Routes>
        <Route path="/" element={<Home />} />
        <Route path="about" element={<About />} />
      </Routes>
    </div>
  );
}

export default App;
